import React, { useState } from 'react';
import { render } from 'react-dom';
import './style.css';
import './convJuros';

export default function Home() {
  return (
    <div>
        <header>
          <div class="container" />
          <div id="logo">
            <img src="logo.png" alt="texto" height="400" width="400" />
          </div>
        </header>
        <div class="containerCentro1">
          <div class="containerCentro2">
            <div id="menu">
              <b class="btn btn-warning" data-toggle="collapse" href="#sim" data-target="#sim">Conversor de Juros</b>
              <a href="index2.html">Conversor de Juros Compostos</a>
            </div>
          </div>
        </div>
        <footer>Desenvolvido por Lucas Marinho</footer>
    </div>
  )
}

render(<Home />, document.getElementById('root'));
